.header {
  z-index: 5;
}

.navigation {
  display: flex;
  justify-content: space-between;

  @media screen and (max-width: 767px) {
    justify-content: start;
  }
}

.navigation img {
  margin-top: 20px;
  align-items: center;

  @media screen and (min-width: 768px) {
    margin-top: 37px;
  }

  @media screen and (min-width: 1200px) {
    position: absolute;
    margin-top: 37px;
  }
}

.header.section {
  background-color: $header-bg-color;
  font-family: DM Sans;

  @media screen and (max-width: 767px) {
    padding-top: 6px;
    padding-bottom: 6px;
  }
}

input {
  display: none;
}
label {
  cursor: pointer;
}

.nav {
  user-select: none;
}

.nav-showmenu {
  background-color: none;
  padding: 5px;
  margin-top: 20px;
  position: absolute;
  left: 90%;
  cursor: pointer;
  transition: left 0.23s;
  z-index: 6;
  width: 30px;
  -webkit-transform: translateZ(0);
  -webkit-backface-visibility: hidden;

  @media screen and (min-width: 768px) {
    margin-top: 35px;
  }

  @media screen and (min-width: 1200px) {
    display: none;
  }
}

.nav-showmenu span {
  display: block;
  height: 5px;
  background-color: $primary-text-pink;
  margin: 5px 0 0;
  transition: all 0.1s linear 0.23s;
  position: relative;
}

.nav-showmenu span.first {
  margin-top: 0;
}

.nav-check {
  display: none;
}

.nav-check:checked ~ .nav-showmenu {
  left: 165px;
  @media screen and (max-width: 767px) {
    left: 90%;
  }
}

.nav-check:checked ~ .menu {
  left: 0;
  @media screen and (max-width: 767px) {
    width: 100%;
  }
}

.nav-check:checked ~ .nav-showmenu span.first {
  -webkit-transform: rotate(45deg);
  top: 10px;
  background-color: $white;
}

.nav-check:checked ~ .nav-showmenu span.second {
  opacity: 0;
}

.nav-check:checked ~ .nav-showmenu span.third {
  -webkit-transform: rotate(-45deg);
  top: -10px;
  background-color: $white;
}

.menu {
  display: block;
  position: absolute;
  list-style: none;
  padding: 10px;
  margin: 0;
  box-sizing: border-box;
  width: 200px;

  height: 100%;
  top: 0;
  left: -200px;
  transition: left 0.2s;
  z-index: 5;
  -webkit-transform: translateZ(0);
  -webkit-backface-visibility: hidden;

  @media screen and (min-width: 1200px) {
    display: flex;
    align-items: center;
    left: 500px;
    position: absolute;
    height: 150px;
  }

  @media screen and (max-width: 1199px) {
    background-color: $menu-bg-color;
  }

  @media screen and (max-width: 767px) {
    background-color: $menu-bg-color;
  }

  @media screen and (min-width: 768px) {
    margin-bottom: 23px;
  }
}

.menu-list-item {
  display: block;
  font-family: DM Sans, sans-serif;
  font-size: 14px;
  line-height: 18px;
  font-weight: 700;
  padding-inline-start: 0px;

  align-items: center;

  text-decoration: none;
  color: $white;

  @media screen and (max-width: 767px) {
    margin-bottom: 23px;
    margin-left: 21px;
  }

  @media screen and (min-width: 1200px) {
    &:not(:last-child) {
      margin-right: 35px;
      white-space: nowrap;
      font-size: 16px;
    }
  }
}

.menu-list-item:hover,
.menu-showsub:hover {
  opacity: 0.7;
}
.menu::-webkit-scrollbar {
  display: none;
}
.nav-check:checked + .nav-showmenu {
  color: #fff;
}

.menu-list-link {
  color: $white;

  @media screen and (min-width: 768px) {
    font-family: DM Sans, sans-serif;
    font-size: 14px;
    font-weight: 700;
    line-height: 18px;
    display: inline-block;
    margin-bottom: 23px;
  }

  &:hover,
  &:focus {
    color: $primary-text-pink;
  }
}

.btn {
  margin-top: 85px;
  cursor: pointer;
  align-items: center;
  text-align: center;
  margin-bottom: 32px;

  @media screen and (min-width: 768px) {
    margin-bottom: 32px;
  }

  @media screen and (min-width: 1200px) {
    margin-right: 150px;
    display: none;
    margin-top: 0px;
  }
}

.nav-submit-button {
  min-width: 180px;
  padding: 10px 32px;

  letter-spacing: 0.06em;
  font-weight: 700;
  font-size: 16px;
  line-height: 1.87;
  color: $primary-text-pink;
  background-color: $white;
  border: none;
  border-radius: 30px;
  display: none;

  @media screen and (min-width: 768px) {
    display: flex;
  }

  &:hover,
  &:focus {
    background-color: #ecebeb;
    color: $primary-text-pink;
  }
}

.nav-button {
  margin: 0;
  padding: 0;
  border: 0;
  background-color: transparent;
  color: $primary-text-pink;

  &::after {
    content: '';
    width: 10px;
    height: 10px;

    margin-left: 16px;
    background-repeat: no-repeat;
  }
}

.arrow {
  fill: $primary-text-pink;
  margin-top: 10px;
}

.button {
  margin-top: 40px;
  cursor: pointer;
  align-items: center;
  text-align: center;
  margin-bottom: 32px;

  @media screen and (min-width: 768px) {
    margin-bottom: 32px;
  }

  @media screen and (min-width: 1200px) {
    margin-bottom: 0px;
  }
}

.nav-submit {
  min-width: 180px;
  padding: 10px 32px;

  letter-spacing: 0.06em;
  font-weight: 700;
  font-size: 16px;
  line-height: 1.87;
  color: $primary-text-pink;
  background-color: $white;
  border: none;
  border-radius: 30px;
  @media screen and (min-width: 1200px) {
    display: none;
  }

  &:hover,
  &:focus {
    background-color: #ecebeb;
    color: $primary-text-pink;
  }
}

.buy-now {
  margin: 0;
  padding: 0;
  border: 0;
  background-color: transparent;
  color: $primary-text-pink;

  &::after {
    content: '';
    width: 10px;
    height: 10px;

    margin-left: 16px;
    background-repeat: no-repeat;
  }
}

sources.sass\\utilit\\_variables.scss:
