sources.sass\\components\\_hero.scss:
.hero {
  min-width: 320px;
  background-color: $header-bg-color;
  overflow: hidden;
  height: 502px;

  @media screen and (min-width: 768px) {
    height: 399px;
    overflow: inherit;
  }

  @media screen and (min-width: 1200px) {
    height: 665px;
  }
}

.container.hero-flex {
  display: flex;
  position: relative;
  height: 100%;

  @media screen and (min-width: 768px) {
    align-items: flex-end;
  }
  }

.hero-left-block {
    display: flex;
    flex-direction: column;
    padding-top: 193px;

    @media screen and (min-width: 768px) {
    padding-top: 102px;
    padding-bottom: 28px;
    margin-right: 110px;
    }
    
  @media screen and (min-width: 1200px) {
    padding-top: 172px;
    padding-bottom: 44px;
  }
}

.hero-text-block {
    @media screen and (max-width: 767px) {
    // position: absolute;
    // bottom: 160px;
    z-index: 2;
    }
    @media screen and (min-width: 768px) {
      display: flex;
      width: 162px;
      flex-direction: column;
      // position: inherit;
      margin-bottom: 19px;
    }
    @media screen and (min-width: 1200px) {
      margin-bottom: 56px;
    }
}

.hero-heading {
  display: inline-block;
  width: 218px;
  margin-bottom: 19px;
  font-family: Titan One;
  font-weight: 400;
  font-size: 26px;
  line-height: 30px;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: $white;

  @media screen and (min-width: 768px) {
    width: 162px;
    font-size: 22px;
    line-height: 25px;
    margin-bottom: 19px;
  }

  @media screen and (min-width: 1200px) {
    width: 277px;
    font-size: 38px;
    line-height: 44px;
    margin-bottom: 20px;
  }
}

.hero-passion {
  font-family: Titan One;
  font-weight: 400;
  font-size: 48px;
  line-height: 47px;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: $primary-text-pink;

  @media screen and (min-width: 768px) {
    font-size: 34px;
    line-height: 31px;
  }

  @media screen and (min-width: 1200px) {
    font-size: 58px;
    line-height: 52px;
  }
}

.hero-buttons {
  display: inline-flex;
  width: 154px;
  @media screen and (min-width: 1200px) {
    width: 257px;
  }
}

.hero-btn {
  display: inline-flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  height: 24px;
  padding: 9px 0;
  font-family: DM Sans;
  font-weight: 400;
  font-size: 8px;
  line-height: 10px;
  border: none;
  border-radius: 11px;

  @media screen and (min-width: 1200px) {
    // padding: 11px 22px;
    height: 40px;
    font-size: 14px;
    line-height: 18px;
    border-radius: 18px;
  }
}

.hero-red {
  width: 63px;
  margin-right: 8px;
  color: $white;
  background-color: $primary-text-pink;

  @media screen and (min-width: 1200px) {
    width: 104px;
  }
}

.hero-red-btn:hover,
.hero-red-btn:focus {
  background-color: rgba(199, 19, 62, 1);
}

.hero-white {
  width: 83px;
  color: $primary-text-pink;
  background-color: $white;
  @media screen and (min-width: 1200px) {
    width: 138px;
  }
}

.hero-white-btn:hover,
.hero-white-btn:focus {
  background-color: $btn-hover-bg-color;
}

.hero-milk-thumb {
  display: none;

  @media screen and (min-width: 768px) {
    display: flex;
    flex-direction: row;
    align-items: flex-end;
    // position: absolute;
    bottom: 28px;
  }

  @media screen and (min-width: 1200px) {
    bottom: 44px;
  }
}

.hero-milk-flex {
  display: flex;
  flex-direction: column;
  padding-bottom: 6px;
}

.hero-milk-tab {
  display: none;  
  @media screen and (min-width: 768px) and (max-width: 1199px) {
    display: block;  
  }
}

.hero-milk-desk {
  display: none;  
  @media screen and (min-width: 1200px) {
    display: block;  
  }
}

.hero-milk-text {
  display: block;
  width: 114px;
  margin-bottom: 7px;
  font-family: DM Sans;
  font-style: normal;
  font-weight: 400;
  font-size: 8px;
  line-height: 12px;
  color: $white;
  
    @media screen and (min-width: 1200px) {
        width: 200px;
        margin-bottom: 20px;
        font-size: 14px;
        line-height: 20px;
    }
}

.hero .arrow-icon {
  @media screen and (max-width: 767px) {
    display: none;
  }
  @media screen and (min-width: 768px) {
    width: 18px;
    height: 18px;
  }
  @media screen and (min-width: 1200px) {
    width: 26px;
    height: 26px;
  }
}

.hero-img {
  @media screen and (max-width: 767px) {
  position: absolute;
  bottom: 0;
  transform: translateX(60%);
  z-index: 1;
  }

.hero-img-mob {
  @media screen and (min-width: 768px) {
    display: none;
  }
}

.hero-img-mob::after {
  content: '';
  position: absolute;
  transform: translateX(-85px);
  bottom: 75px;
  width: 346px;
  height: 346px;
  border-radius: 50%;
  background-color: $accent-text-pink;
  z-index: -1;

  @media screen and (min-width: 768px) {
    display: none;
  }
}

.hero-img-tab {
  display: none;

  @media screen and (min-width: 768px) and (max-width: 1199px) {
    display: block;
    margin-right: 45px;
    margin-top: auto;
    position: relative;
    // margin-bottom: -4px;
    z-index: 3;
  }
}

.hero-img-tab::before {
  content: '';
  position: absolute;
  transform: translateX(-80px);
  bottom: 46px;
  width: 324px;
  height: 324px;
  border-radius: 50%;
  background-color: $accent-text-pink;
  z-index: -1;

}

.hero-img-desk {
  display: none;

  @media screen and (min-width: 1200px) {
    display: block;
    margin-right: 48px;
    margin-top: auto;
    position: relative;
    // margin-bottom: -4px;
    z-index: 3;
  }
}

.hero-img-desk::after {
  content: '';
  position: absolute;
  transform: translateX(-119px);
  bottom: 75px;
  width: 538px;
  height: 538px;
  border-radius: 50%;
  background-color: $accent-text-pink;
  z-index: -1;
  }
}

.hero-right-block {
  display: none;
  @media screen and (min-width: 768px){
   display: flex; 
   flex-direction: column;
   align-items: flex-end;
  }
}

.hero-numbers-tab {
  display: none;
  @media screen and (min-width: 768px) and (max-width: 1199px){
  display: flex;
  flex-direction: column;
    margin-bottom: 72px;
}
}

.hero-numbers-desk {
  display: none;
  @media screen and (min-width: 1199px) {
    display: flex;
    flex-direction: column;
    margin-bottom: 110px;
  }
}

.hero-16-tab {
  margin-bottom: 13px;
}

.hero-16-desk {
  margin-bottom: 15px;
}

.hero-girl-tab {
  display: inline-block;
  margin-top: auto;
  z-index: 3;
  @media screen and (min-width:1200px) {
    display: none;
  }
}

.hero-girl-desk {
  display: none;
  @media screen and (min-width: 1200px) {
  display: inline-block;
  margin-top: auto;
  z-index: 3;
  }
}

sources.sass\\components\\_products.scss:
.products {
    background-color: $white;
    font-family: DM Sans;
    text-align: center;

    @media screen and (max-width: 767px) {
        padding-top: 121px;
        padding-bottom: 98px;    
    }

    @media screen and (min-width: 768px) {
        padding-top: 122px;
        padding-bottom: 112px;    
    }

    @media screen and (min-width: 1200px) {
        padding-top: 127px;
        padding-bottom: 119px;    
    }
}

.products-list {
    @media screen and (min-width: 768px) {
        display: flex;
        flex-wrap: wrap;
        margin: -10px;
    }
    @media screen and (min-width: 1200px) {
        margin: -12px;
    }
}

.products-item {
    position: relative;
    padding: 161px 40px 40px;
    border-radius: 24px;

    &:not(:last-child) {
        @media screen and (max-width: 767px){
            margin-bottom: 130px;
        }
    }

    &:nth-child(1) {
        background-color: #FFB8CA;
    }

    &:nth-child(2) {
        background-color: #F0D1A5;
    }

    &:nth-child(3) {
        background-color: $green-color;
    }

    @media screen and (min-width: 768px) {
        width: calc((100% - 6 * 10px) / 3);
        margin: 10px;     
        padding: 152px 11px 40px;      
    }

    @media screen and (min-width: 1200px) {
        width: calc((100% - 6 * 12px) / 3);
        margin: 12px;     
        padding: 163px 44px 50px;      
    }
}

.products-picture {
    display: block;
    position: absolute;
    left: 50%;
    transform: translate(-50%, 0%);

    @media screen and (max-width: 767px) {
        top: -23%;        
        width: 249px;      
    }  
    
    @media screen and (min-width: 768px) {
        top: -19%;  
        width: 100%;   
    }

    @media screen and (min-width: 1200px) {       
        top: -37%;        
    }
}

// стили текста и заголовков

.products-title-h2,
.products-title-h3,
.products-title-h4 {
    font-family: Titan One;
    font-weight: 400;
    text-transform: uppercase;
}

.products-title-h2 {
    font-size: 34px;
    line-height: 1.15;
    letter-spacing: 0.04em;
    color: $primary-text-pink;
    margin-bottom: 144px;

    @media screen and (min-width: 768px) {
        font-size: 48px;
        margin-bottom: 150px;
    }
    @media screen and (min-width: 1200px) {
        font-size: 58px;
        margin-bottom: 259px;
        line-height: 1.14;
        letter-spacing: 0.06em;
    }
}

.products-title-h3 {
    font-size: 18px;
    line-height: 1.17;
    color: $accent-text-pink;
    margin-bottom: 15px;
    @media screen and (min-width: 768px) {
        font-size: 26px;
    }
    @media screen and (min-width: 1200px) {
        font-size: 30px;
        line-height: 1.14;
        letter-spacing: 0.04em;
    }
}

.products-title-h4 {
    font-size: 20px;
    line-height: 1.15;
    letter-spacing: 0.04em;
    color: $white;
    margin-bottom: 30px;
    }

.products-text {
    font-family: DM Sans;    
    font-weight: 700;
    font-size: 14px;
    line-height: 1.52;
    letter-spacing: 0.04em;
    color: $white;
    margin: 30px 0px;
    @media screen and (min-width: 768px) {
        line-height: 1.76;
        margin: 30px 0px 40px;
    }
    @media screen and (min-width: 1200px) {
        font-size: 16px;
        margin: 32px 0px 62px;
    }
}


// стили иконок

.dots-icon,
.arrow-icon {
    display: inline-flex;
    background-repeat: no-repeat;
    background-size: contain;
}

.dots-icon {
    width: 26px;
    height: 6px;
    background-image: url(../image/products/dots.svg);
}

.arrow-icon {
    width: 40px;
    height: 40px;
    background-image: url(../image/products/arrow-right.svg);
}

sources.sass\\components\\_production.scss:
.production.section {
  background-color: $secondary-bg-color;
  font-family: DM Sans;

  @media screen and (max-width: 767px) {
    padding-top: 125px;
    padding-bottom: 145px;
  }

  @media screen and (min-width: 768px) {
    padding-top: 130px;
    padding-bottom: 246px;
  }

  @media screen and (min-width: 1200px) {
    padding-top: 125px;
    padding-bottom: 310px;
  }

  @media screen and (max-width: 767px) {
    background-repeat: no-repeat;
    background-position: center;
    background-image: url('../image/production-section/bg-mobile.png');

    @media screen and (min-device-pixel-ratio: 2),
      screen and (-webkit-min-device-pixel-ratio: 2),
      screen and (-o-min-device-pixel-ratio: 2/1),
      screen and (min-resolution: 192dpi),
      screen and (min-resolution: 2dppx) {
      background-size: contain;
      background-image: url('../image/production-section/bg-mobile-2x.png');
    }
  }

  @media screen and (min-width: 1200px) {
    background-repeat: no-repeat;
    background-position: center;
    background-image: url('../image/production-section/bg-desktop.png');

    @media screen and (min-device-pixel-ratio: 2),
      screen and (-webkit-min-device-pixel-ratio: 2),
      screen and (-o-min-device-pixel-ratio: 2/1),
      screen and (min-resolution: 192dpi),
      screen and (min-resolution: 2dppx) {
      background-size: contain;
      background-image: url('../image/production-section/bg-desktop-2x.png');
    }
  }
}

.production-pretitle {
  margin-bottom: 15px;

  text-align: center;
  font-family: Titan One;
  font-size: 18px;
  font-weight: 400;
  line-height: 1.17;
  text-transform: uppercase;
  color: $accent-text-pink;

  @media screen and (min-width: 768px) {
    font-size: 26px;
    line-height: 1.15;
  }

  @media screen and (min-width: 1200px) {
    font-size: 30px;
  }
}

.production-title {
  text-align: center;
  font-family: Titan One;
  font-weight: 400;
  line-height: 1.15;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: $primary-text-pink;

  @media screen and (max-width: 767px) {
    font-size: 34px;
    margin-bottom: 26px;
  }

  @media screen and (min-width: 768px) {
    font-size: 48px;
    margin-bottom: 100px;
  }

  @media screen and (min-width: 1200px) {
    font-size: 58px;
    letter-spacing: 0.06em;
    line-height: 1.14;
    margin-bottom: 106px;
  }
}

.production-content {
  @media screen and (min-width: 768px) {
    display: flex;
    align-items: center;
    margin-bottom: 66px;
  }

  @media screen and (min-width: 1200px) {
    margin-bottom: 40px;
  }
}

.production-picture {
  @media screen and (max-width: 767px) {
    margin-bottom: 46px;
  }

  @media screen and (min-width: 768px) and (max-width: 1199px) {
    width: 340px;
    margin-right: 17px;
    transform: translateY(-25%);
  }

  @media screen and (min-width: 1200px) {
    width: 516px;
    margin-right: 74px;
    transform: translateY(5%);
  }
}

.production-description {
  @media screen and (max-width: 767px) {
    padding-right: 30px;
    padding-left: 30px;
    margin-bottom: 40px;
  }

  @media screen and (min-width: 768px) {
    width: 340px;
  }

  @media screen and (min-width: 1200px) {
    width: 463px;
  }
}

.production-text {
  margin-bottom: 28px;
  font-weight: 500;

  @media screen and (max-width: 767px) {
    line-height: 1.6;
    font-size: 12px;
  }

  @media screen and (min-width: 768px) {
    line-height: 1.8;
    font-size: 14px;

    &.breaker {
      margin-bottom: 60px;
      letter-spacing: 0.04em;
    }
  }

  @media screen and (min-width: 1200px) {
    margin-bottom: 35px;
    font-size: 16px;
    letter-spacing: 0.04em;

    &.breaker {
      margin-bottom: 45px;
      font-size: 14px;
      letter-spacing: 0.04em;
    }
  }

  &.gray {
    color: $primary-text-color;
  }
}

.production-button {
  display: flex;
  align-items: center;
  justify-content: center;

  width: 176px;
  height: 44px;

  background-color: $white;
  border-radius: 22px;

  font-weight: 700;
  font-size: 14px;
  line-height: 1.3;
  color: $primary-text-pink;

  &-icon {
    margin-left: 14px;
    fill: currentColor;
  }

  &:hover,
  &:focus {
    background-color: $btn-hover-bg-color;
  }
}

.production-ingridients {
  @media screen and (min-width: 768px) {
    display: flex;
  }
}

.production-item {
  @media screen and (max-width: 767px) {
    width: 230px;
    margin-bottom: 38px;
  }

  @media screen and (min-width: 768px) {
    width: 180px;
    margin-right: 60px;

    &:last-child {
      margin-right: 0;
    }
  }

  @media screen and (min-width: 1200px) {
    width: 330px;
    margin-right: 30px;

    &:last-child {
      margin-right: 0;
    }
  }
}

.production-icons {
  @media screen and (max-width: 767px) {
    margin-bottom: 16px;
  }

  @media screen and (min-width: 768px) {
    margin-bottom: 36px;
  }

  @media screen and (min-width: 1200px) {
    margin-bottom: 40px;
  }
}

.production-qty {
  font-family: Titan One;
  font-size: 36px;
  line-height: 1.14;
  letter-spacing: 0.04em;
  text-transform: uppercase;

  color: $primary-text-pink;

  @media screen and (max-width: 767px) {
    margin-bottom: 10px;
  }

  @media screen and (min-width: 768px) {
    margin-bottom: 13px;
    font-size: 48px;
  }

  @media screen and (min-width: 1200px) {
    margin-bottom: 15px;
    font-size: 58px;
  }
}

.production-qty-text {
  font-weight: 700;
  line-height: 1.7;
  @media screen and (max-width: 767px) {
    font-size: 12px;
  }
  @media screen and (min-width: 768px) {
    font-size: 14px;
  }
  @media screen and (min-width: 1200px) {
    font-size: 16px;
  }
}

sources.sass\\components\\_comments.scss:
.comments {
  display: block;
  max-width: 280px;
  margin-bottom: 30px;
  margin-left: auto;
  margin-right: auto;
  padding-bottom: 86px;

  @media screen and (min-width: 320px) {
    max-width: 620px;
  }
  @media screen and (min-width: 768px) {
    min-width: 620px;
    margin-bottom: 35px;
    padding-bottom: 119px;
  }
  @media screen and (min-width: 1200px) {
    max-width: 926px;
    padding-bottom: 132px;
  }
}

.rev_slider {
  padding-top: 80px;
  text-align: center;
}

.slider .slick-dots li button::before {
  margin-top: 20px;
  font-size: 12px;
  color: $bc-comment;
}
.slider .slick-dots li .slick-active button {
  width: 13px;
  height: 12px;
  color: $bc-comment;
  // background-image: url(../image/comment-section/symbol-defs.svg#icon-home);
}

.slider img {
  margin-bottom: 30px;
  margin-left: auto;
  margin-right: auto;

  @media screen and (min-width: 1200px) {
    margin-bottom: 20px;
  }

  @media screen and (min-width: 1200px) {
    margin-bottom: 15px;
  }
}

.comment-box {
  background-color: $bg-comment;
  position: relative;
  text-align: center;
  max-width: 100%;
  height: 308px;
  margin-bottom: 30px;
  padding: 43px 50px 24px 60px;

  @media screen and (min-width: 768px) {
    width: 620px;
    height: 165px;
    margin-bottom: 24px;
    padding-top: 50px;
    padding-left: 80px;
  }

  @media screen and (min-width: 1200px) {
    width: 936px;
    height: 140px;
    margin-bottom: 15px;
    // padding: 47px 89px 39px 87px;
  }
}

.comments-text {
  width: 180px;
  display: block;
  position: absolute;
  padding-left: 10px;
  padding-right: 10px;
  color: $black;
  font-style: normal;
  font-weight: 500;
  font-size: 12px;
  line-height: 31px;
  letter-spacing: 0.04em;
  z-index: 10;

  background: repeating-linear-gradient(
    to bottom,
    $border-color 0px,
    transparent 1px,
    transparent 30px,
    $border-color 30px,
    $border-color 31px
  );
  background-position: center bottom 3px;

  @media screen and (min-width: 768px) {
    width: 460px;
    // padding-right: 30px;
    font-size: 14px;
    line-height: 30px;
  }
  @media screen and (min-width: 1200px) {
    width: 750px;
    font-size: 16px;
  }
}
.quotes {
  position: absolute;
  top: 28px;
  left: 65px;
  z-index: 1;

  @media screen and (min-width: 768px) {
    top: 30px;
    left: 40px;
  }

  @media screen and (min-width: 768px) {
    top: 32px;
    left: 50px;
  }
}

.circle-list {
  display: flex;
  justify-content: center;
  margin-bottom: 18px;
}

.circle-item {
  display: block;
  width: 4px;
  height: 4px;
  border-radius: 50%;
  background-color: $bc-comment;

  &:not(:last-child) {
    margin-right: 10px;
  }
}

.comment-icon {
  display: flex;
  justify-content: center;
  margin-bottom: 20px;
}

.comments-location {
  color: $black;
  font-style: normal;
  font-weight: 500;
  font-size: 14px;
  line-height: 1.85;

  @media screen and (min-width: 768px) {
    font-size: 16px;
  }
  @media screen and (min-width: 1200px) {
    font-size: 20px;
  }
}

// .comment-slider:not(:first-child) {
//   fill: #d9d9d9;
// }
// // .comment-slider:not(:last-child) {
// //   margin-right: 18px;
// // }

sources.sass\\components\\_contacts.scss:
.contacts {
    background-color: $bg-pink;

    @media screen and (min-width: 1200px) {
        background-image: url(./../image/contacts/contacts-desk.png);
        background-position: center;
        background-repeat: no-repeat;
        background-size: contain;
        z-index: 3;

        @media screen and (min-device-pixel-ratio: 2),
        screen and (-webkit-min-device-pixel-ratio: 2),
        screen and (-o-min-device-pixel-ratio: 2/1),
        screen and (min-resolution: 192dpi),
        screen and (min-resolution: 2dppx) {
        background-size: contain;
        background-repeat: no-repeat;
        background-image: url(./../image/contacts/contacts-desk@2x.png);
        z-index: 3;
        }
    }
}    

.contacts-div {
    margin-top: 170px;

}
.contacts-list {
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-left: auto;
    margin-right: auto;

    @media screen and (min-width: 768px) {
        display: flex;
        flex-wrap: wrap;
        flex-direction: row;
        align-items: baseline;
        justify-content: center;
        margin-bottom: 81px;
        
        .contacts-card + .contacts-card {
            margin-left: 20px;
        }
    }

    @media screen and (min-width: 1200px) {
        margin-bottom: 86px;

        .contacts-card + .contacts-card {
            margin-left: 30px;
        }
    }
}
.contacts-card {
    display: block;
    margin-bottom: 20px;
    padding: 43px 21px 43px 20px;
    width: 220px;
    height: 427px;
    font-family: $font-contacts;
    font-size: 12px;

    background-color: $white;
    border-radius: 24px;
    box-shadow: 0px 8px 30px rgba(212, 20, 67, 0.1);

    &:first-child {
        margin-top: -84px;
    }

    @media screen and (max-width: 767px) {
        &:last-child {
            margin-bottom: 54px;
        }
    }
    @media screen and (min-width: 768px) {
        font-size: 14px;
        height: 544px;
        margin-top: -78px;
        padding: 50px 32px 50px 31px;
    }
    @media screen and (min-width: 1200px) {
        font-size: 16px;
        width: 330px;
        height: 572px;
        margin-top: -102px;
        padding: 51px 44px 62px 43px;
    }
}
.contacts-item {
    & b {
        display: inline-block;
        margin-bottom: 10px;
        font-size: 12px;
        line-height: 1.85;
        letter-spacing: 0.04em;

        @media screen and (min-width: 768px) {
            font-size: 14px;
            line-height: 1.86;
        }
        @media screen and (min-width: 1200px) {
            font-size: 16px;
        }
    } 

    & .contacts-txt {
        font-size: 12px;
        line-height: 1.8;
        color: $primary-text-color;

        @media screen and (min-width: 768px) {
            font-size: 14px;
            line-height: 1.66;
        }
        @media screen and (min-width: 1200px) {
            font-size: 16px;
            line-height: 1.83;
            letter-spacing: 0.04em;
        }
    }
    &:first-child {
        margin-bottom: 25px;
    }
    & .days {
        color: $black;
        font-weight: 500;
        line-height: 1.85;
    }
    & .hours {
        color: $accent-text-pink;
    }
}

.contacts-tag {
    display: flex;
    justify-content: center;
    align-items: center;
    margin-bottom: 25px;
    height: 16px;

    font-size: 12px;
    line-height: 1.86;
    letter-spacing: 0.04em;
    color: $white;
    background: $beige-color;
    border-radius: 4px;

    @media screen and (min-width: 768px) {
        margin-bottom: 30px;
        height: 28px;
        font-size: 16px;
    }
    @media screen and (min-width: 1200px) {
        margin-bottom: 32px;
        height: 28px;
        &.cafe {
            width: 73px;
        }
        &.foodtruck {
            width: 138px;
        }
    }

    &.cafe {
        width: 80px;
        background-color: $beige-color;
    }
    &.foodtruck {
        width: 130px;
        background-color: $green-color;
    }
}
.monday {
    position: relative;
    margin-top: 50px;

    &::before {
        position: absolute;
        top: -25px;
        display: block;
        align-content: flex-start;
        content: "";
        width: 179px;
        height: 1px;
        border-radius: 2px;
        background-color: $border-color;

        @media screen and (min-width: 768px) {
            width: 157px;
        }
        @media screen and (min-width: 1200px) {
            width: 234px;
        }
    }
    & p:last-child {
        margin-bottom: 10px;
        
        @media screen and (min-width: 768px) {
            margin-bottom: 16px;
        }
        @media screen and (min-width: 1200px) {
            margin-bottom: 15px;
        }
    }
}

.weekend {
    position: relative;
    margin: 0;

    & p:last-child {
        margin-bottom: 25px;
    }

    &::after {
        display: block;
        align-content: center;
        content: "";

        width: 179px;
        height: 1px;
        border-radius: 2px;
        background-color: $border-color;

        @media screen and (min-width: 768px) {
            width: 157px;
        }
        @media screen and (min-width: 1200px) {
            width: 234px;
        }
    }    
}
.contacts-address {
    margin-top: 25px;

    @media screen and (min-width: 768px) {
        margin-top: 30px;
    }
    @media screen and (min-width: 1200px) {
        margin-top: 32px;
    }

    & a {        
        font-family: $font-contacts;
        font-style: normal;
        font-size: 12px;
        line-height: 1.5;

        color: $primary-text-color;

        @media screen and (min-width: 768px) {
            font-size: 14px;
            line-height: 1.83;
        }
        @media screen and (min-width: 1200px) {
            font-size: 16px;
            line-height: 1.83;        }
    }
}

/* BUTTONS */
.contact-buttons {
    display: flex;
    flex-direction: column;
    align-items: center;

    @media screen and (min-width: 768px) {
        display: flex;
        flex-direction: row;
        align-items: baseline;
        justify-content: center;
    }

    @media screen and (min-width: 1200px) {
        display: flex;
        flex-direction: row;
        align-items: baseline;
        justify-content: center;
    }
}

.contacts-link {
    display: flex;
    align-items: center;
    justify-content: center;
    text-align: center;    
    margin: 0;
    width: 161px;
    height: 44px;
    border-radius: 22px;
    cursor: pointer;
    
    & .contacts-button {
        font-family: $font-contacts;
        font-weight: 700;
        font-size: 16px;
        line-height: 1.3;
    }

    & .contacts-arrow {
        margin-left: 8px;
        width: 8px;
        height: 8px;
    }
}
.red {        
    margin-bottom: 10px;
    color: $white;
    background: #D41342;

    & .contacts-arrow {
        fill: currentColor;
    }

    @media screen and (min-width: 768px) {
        width: 191.45px;
        margin-right: 14.5px;
    }
    @media screen and (min-width: 1200px) {
        width: 198px;
        margin-right: 15px;
    }
}
.white {
    color: $primary-text-pink;
    background-color: $white;

    & .contacts-arrow {
        fill: currentColor;
    }

    @media screen and (min-width: 768px) {
        width: 174px;
        margin-right: 14.5px;
    }
    @media screen and (min-width: 1200px) {
        width: 180px;
        margin-right: 15px;
    }
    
    &:hover {
        color: $primary-text-pink;
        background-color: $btn-hover-bg-color;   
    }
}

sources.sass\\components\\_footer.scss:
footer {
  min-width: 320px;
  background-color: $secondary-bg-color;
}

footer .container {
  padding: 113px 20px 0 20px;
  margin: 0 auto;
  width: 320px;
  @media screen and (min-width: 768px) {
    min-width: 768px;
    height: 439px;
    display: flex;
    justify-content: space-between;
    flex-direction: row;
    padding: 158px 36px 0 36px;
  }
  @media screen and (min-width: 1200px) {
    min-width: 1200px;
    height: 377px;
    padding-left: 114px;
    padding-right: 116px;
    padding-top: 165px;
  }
}
footer .slogan {
  font-family: Titan One;
  font-style: normal;
  font-weight: 400;
  width: 234px;
  height: 135px;
  @media screen and (min-width: 768px) {
    width: 340px;
    height: 190px;
    padding-top: 7px;
  }
  @media screen and (min-width: 1200px) {
    width: 477px;
    height: 115px;
    padding: 0;
  }
}
footer .slogan h3 {
  font-weight: 400;
  font-size: 18px;
  line-height: 1.17;
  text-transform: uppercase;
  color: $accent-text-pink;
  margin-bottom: 17px;
  @media screen and (min-width: 768px) {
    font-size: 26px;
    line-height: 1.15;
    letter-spacing: 0.04em;
    margin-bottom: 16px;
  }
  @media screen and (min-width: 1200px) {
    font-size: 30px;
    line-height: 1.13;
    margin-bottom: 15px;
  }
}
footer .slogan h2 {
  font-size: 34px;
  line-height: 1.15;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: $primary-text-pink;
  @media screen and (min-width: 768px) {
    font-size: 48px;
    letter-spacing: 0.06em;
  }
  @media screen and (min-width: 1200px) {
    font-size: 58px;
  }
}
footer .social-icon .icon {
  fill: $white;
}
footer .social-icon li {
  display: block;
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: #fea5bb;
  border-radius: 50%;
  width: 32px;
  height: 32px;
  @media screen and (min-width: 768px) {
    width: 34px;
    height: 34px;
  }
  @media screen and (min-width: 1200px) {
    transition-property: background-color;
    transition-duration: 250ms;
    transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
    &:focus,
    &:hover {
      background-color: $primary-text-pink;
    }
  }
}
footer .contact-us {
  padding-top: 43px;
  padding-bottom: 43px;
  display: flex;
  flex-direction: column;
  align-items: flex-end;
  @media screen and (min-width: 768px) {
    width: 268px;
    height: 106px;
    padding: 0;
  }
  @media screen and (min-width: 1200px) {
    width: 319px;
    height: 114px;
  }
}
footer .social-icon {
  display: block;
  display: flex;
  width: 152.5px;
  height: 32px;
  justify-content: space-between;
  @media screen and (min-width: 768px) {
    width: 162px;
    height: 34px;
  }
  @media screen and (min-width: 1200px) {
    width: 151px;
    height: 34px;
    padding-right: 5px;
  }
}
footer .telefon span {
  font-family: DM Sans;
  font-style: normal;
  font-weight: 700;
  line-height: 1.86;
  @media screen and (min-width: 768px) {
    letter-spacing: 0.02em;
  }
}
footer .tel {
  font-family: DM Sans;
  font-style: normal;
  font-weight: 500;
  line-height: 1.86;
  color: $primary-text-pink;
}
footer .telefon {
  width: 230px;
  height: 22px;
  margin-top: 46px;
  font-size: 12px;
  @media screen and (min-width: 768px) {
    font-size: 14px;
    width: 100%;
  }
  @media screen and (min-width: 1200px) {
    margin-top: 50px;
    width: 319px;
    font-size: 16px;
    letter-spacing: 0.02em;
  }
}
footer .copiright span {
  font-family: DM Sans;
  font-style: normal;
  font-weight: 700;
  font-size: 14px;
  line-height: 1.52;
  color: $primary-text-color;
}
footer .copiright {
  text-align: center;
  padding: 22px 76px 25px 64px;
  border-top: 1px solid $border-color;
  margin-left: -20px;
  min-width: 320px;
  @media screen and (min-width: 1200px) {
    padding: 9px 76px 10px 64px;
  }
}

@media screen and (min-width: 768px) {
  footer .svg-github {
    width: 20px;
    height: 20px;
  }
  footer .svg-telegram {
    width: 20.4px;
    height: 15.9px;
  }
  footer .svg-facebook {
    width: 19px;
    height: 43px;
  }
  .copiright br {
    display: none;
  }
}
@media screen and (min-width: 1200px) {
  footer .slogan br {
    display: none;
  }
}
